let initialState = { 
	img:['https://www.sticky.digital/wp-content/uploads/2013/11/img-6.jpg',
	'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTxYemmTO9egxdCwvuKQpKd03kZvLfE8b2fWGpzNYZ3RthVT_QvV5VxW0bFYoGZRVn5P6euePMxlI63xIImweC0BiSTVGJVLu27pA&usqp=CAU&ec=45695924',
	'https://www.imgonline.com.ua/examples/red-yellow-flower.jpg',
	'https://i.pinimg.com/originals/23/53/6e/23536e5d6fd64cb25644a98622e21d9b.jpg',
	'https://i.pinimg.com/236x/4c/bd/cf/4cbdcf9d6a180e8bce2aa5e2ceb67a07--surf-house-villa.jpg',
	'https://www.imgonline.com.ua/examples/red-yellow-flower.jpg']
}

const InstagramReducer = (state = initialState , action) => {

	switch(action.type){
		case 'NEW-STYLE' :
		return{
			...state,	
			style : 'auto'
		}

		default:
			return state;	
	} 	
}

export default InstagramReducer;
